\deftab720
\pard\pardeftab720\sa320\qj

\f0\fs20 \cf0 Equalizer is an open source programming interface and resource management system for scalable graphics applications. An Equalizer application can run unmodified on any visualization system, from a singlepipe workstation to large scale graphics clusters and shared memory visualization systems. Equalizer is build from ground up as a parallel, scalable programming interface solving the common problems for any multipipe application.}

{\rtf1\mac\ansicpg10000\cocoartf824\cocoasubrtf410 {\fonttbl\f0\fnil\fcharset77 Georgia-Bold;\f1\fswiss\fcharset77 Helvetica;\f2\fswiss\fcharset77 Helvetica-Bold; } {\colortbl;\red255\green255\blue255;} {\*\listtable{\list\listtemplateid1\listhybrid{\listlevel\levelnfc23\levelnfcn23\leveljc2\leveljcn2\levelfollow0\levelstartat1\levelspace360\levelindent0{\*\levelmarker \{disc\}}{\leveltext\leveltemplateid0\'02\'05.;}{\levelnumbers\'01;}}{\listname ;}\listid1} {\list\listtemplateid2\listhybrid{\listlevel\levelnfc23\levelnfcn23\leveljc2\leveljcn2\levelfollow0\levelstartat1\levelspace360\levelindent0{\*\levelmarker \{disc\}}{\leveltext\leveltemplateid0\'02\'05.;}{\levelnumbers\'01;}}{\listname ;}\listid2}} {\*\listoverridetable{\listoverride\listid1\listoverridecount0\ls1}{\listoverride\listid2\listoverridecount0\ls2}} \deftab720 \pard\pardeftab720\sa380\qc
\f0\b\fs24 \cf0 Programming Interface\ \pard\pardeftab720\sa380\qj
\f1\b0\fs20 \cf0 Equalizer uses a callback-driven interface. Applications provide their rendering callbacks, which are called by the Equalizer framework according to the current configuration and system load. Process and thread creation, task synchronization and network connections are externalized from the application and handled transparently by the Equalizer framework.\ \pard\pardeftab720\sa320\qj \cf0 The multi-pipe programming interface follows the natural execution model of any multi-pipe application. The application needs to separate the rendering routines from the core application to make them distributable. Equalizer abstracts common graphic entities into C++ classes, for example:\ \pard\tx220\tx720\pardeftab720\li720\fi-720\qj \ls1\ilvl0 \f2\b \cf0 \'a5 Node \f1\b0 - a single computer in the cluster\ \ls1\ilvl0 \f2\b \'a5 Pipe \f1\b0 - a graphics card and rendering thread\ \ls1\ilvl0 \f2\b \'a5 Window \f1\b0 - an OpenGL drawable\ \ls1\ilvl0 \f2\b \'a5 Channel \f1\b0 - a viewport within a window\ \ \pard\pardeftab720\qj \cf0 The application subclasses these entities, and overrides methods to provide the application's rendering code. Each method corresponds to a task, and for all of them Equalizer provides a default method which implements the typical use case. This allows a quick start for the developer, which can the replace the defaults gradually with his own code. Some of the most important methods are:\ \ \pard\tx220\tx720\pardeftab720\li720\fi-720\qj \ls2\ilvl0 \f2\b \cf0 \'a5 Channel::draw \f1\b0 - render using the provided frustum, \ viewport and range\ \ls2\ilvl0 \f2\b \'a5 Window::init \f1\b0 - init OpenGL drawable and state\ \ls2\ilvl0 \f2\b \'a5 Pipe::startFrame \f1\b0 - update frame-specific data\ \ls2\ilvl0 \f2\b \'a5 Node::init \f1\b0 - initialise per node application data\ \ \pard\pardeftab720\sa320\qj \cf0 Equalizer provides an API to build network-distributed applications. In contrast to other cluster API's, such as MPI or PVM, this API is designed for the development of interactive applications. Certain characteristics of visualization software, e.g. the frame-driven rendering, are exploited for better performance and an easier to use programming interface.}

