\f0\b\fs24 \cf0 Resource Management\
\pard\pardeftab720\sa320\qj

\f1\b0\fs20 \cf0 Equalizer uses a configuration server to optimally allocate and balance the available resources on the visualization system. The server is configured using a hierarchically structured configuration file to describe the available resources, and the combination of the resources for rendering. Equalizer applications can also run without a server, in which case they will automatically configure themselves for the local workstation. Possible environments for Equalizer are centralized visualization clusters, multipipe shared memory visualizaton computers or single- and multipipe workstations.}

{\rtf1\mac\ansicpg10000\cocoartf824\cocoasubrtf410 {\fonttbl\f0\fnil\fcharset77 Georgia-Bold;\f1\fswiss\fcharset77 Helvetica;\f2\fswiss\fcharset77 Helvetica-Bold; } {\colortbl;\red255\green255\blue255;} \pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\sa80\qc\pardirnatural
\f0\b\fs24 \cf0 \expnd0\expndtw0\kerning0 Use Cases \f1\b0\fs20 \ \pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\sa80\qj\pardirnatural \cf0 Equalizer abstracts the configuration from the application code. This allows the same application to be deployed in different ways, for example: \f2\b \expnd0\expndtw0\kerning0 \ Display Walls \f1\b0 \expnd0\expndtw0\kerning0 are driven by Equalizer by running a local OpenGL execution thread for each display. \f2\b \expnd0\expndtw0\kerning0 \ Immersive Installations \f1\b0 \expnd0\expndtw0\kerning0 use passive or active stereo rendering with head tracking, which is supported by Equalizer. \f2\b \expnd0\expndtw0\kerning0 \ Multipipe Workstations \f1\b0 \expnd0\expndtw0\kerning0 are an affordable way to scale the rendering performance and display size. \f2\b \expnd0\expndtw0\kerning0 \ Remote Visualization Clusters \f1\b0 \expnd0\expndtw0\kerning0 are an cost-efficient way of centralizing large scale data. \
\f2\b \expnd0\expndtw0\kerning0 Scalable Rendering \f1\b0 \expnd0\expndtw0\kerning0 is used to parallelize the rendering of a single view across multiple graphic cards and processors.}
